import React from "react"

const Navbar = () => {
  const headerStyle = {
    padding: "20px 0",
    lineHeight: "1.5em",
  }

  return (
    <header style={headerStyle} >
      <div class="navbar">
        <div class="logo">
          <a href="#" class="brand-logo">Logo</a>
        </div>
        
      </div>
    </header>
  )
}

export default Navbar
